import React from "react";

const PDetailed = () => {
  return (
    <div className=" shadow col-span-3 m-3 rounded-2xl bg-gray-300 h-auto p-2">
      <h1 className="text-gray-700 text-base m-2   box-border h-auto w-32 border-4 px-2 bg-yellow-300 rounded-xl">
        Basic Info:
      </h1>
      <div className="text-gray-700 text-base m-2    h-auto w-auto border-4 px-2 py-2 bg-red-900">
        <div className="flex">
          <h1 className="text-base text-gray-700 font-bold">Full Name:</h1>
          <h1 className="text-base mx-2">Khalid Ibn Alam Utsob</h1>
        </div>
        <div className="flex">
          <h1 className="text-base text-green-500 font-bold">Gender:</h1>
          <h1 className="text-base mx-2">Male</h1>
          <h1 className="text-base mx-2 text-gray-700 font-bold">
            Date of Birth:
          </h1>
          <h1 className="text-base mx-2">1998-07-16</h1>
        </div>
      </div>
    </div>
  );
};

export default PDetailed;
